      return response.json()
    }).catch(error => {
      return error;
    })
  }

  static retrieveProject(id){
    return fetch(`http://localhost:3001/api/v1/projects/${id.id}`, {
      method: 'GET',
      headers: Auth.fetchToken()
    }).then(response => {
      return response.json()
    }).catch(error => {
      return error;
    })
  }

}

export default projectApi
